import React, { Component } from 'react';
import LevelSetup from "./LevelSetup";
import TargetConfiguration from "./TargetConfiguration";
export default class Reward extends Component {
  constructor(props) {
    super(props);
    this.state = {

    }
  }
  componentDidMount() {
    this.props.setHeader("Reward");
  }
  render() {
    return (
      <div className="container-fluid">
        <div className="row">
          <div className="col-md-12">
            <div className="mainbg cus-pills h-100">
              <ul className="nav nav-pills">

                <li className="nav-item">
                  <a className="nav-link active" href="#levelSetup" data-toggle="tab">Level Setup</a>
                </li>

                <li className="nav-item">
                  <a className="nav-link" data-toggle="tab" href="#targetConfig" role="tab" aria-controls="profile" aria-selected="false">Target Configuration</a>
                </li>

              </ul>
              <div className="p-0 d-material-tabcontent">
                <div className="tab-content _participant">
                  <div className="tab-pane show active " role="tab" id="levelSetup" role="tabpanel">
                    <div className="level__setup__wrapper">
                      <LevelSetup
                        url_reward={this.props.url_reward}
                        ajaxUtil={this.props.ajaxUtil}
                        loadingFunction={this.props.loadingFunction}
                        setNotification={this.props.setNotification} />
                    </div>
                  </div>
                  <div className="tab-pane fade" id="targetConfig" role="tabpanel" aria-labelledby="profile-tab">
                  <TargetConfiguration
                        url_reward={this.props.url_reward}
                        ajaxUtil={this.props.ajaxUtil}
                        loadingFunction={this.props.loadingFunction}
                        setNotification={this.props.setNotification} />
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    )
  }
}
